import React from 'react'

const changeVideoKey = new Event('changeVideoKey')

const VideoPlayer = (props) =>{
  React.useEffect(()=>{
    window.addEventListener('changeVideoKey',props.changeVideoSrc(2))
  })
    return(
        <video id='video-player' style={props.style} controls>
        <source src={`http://localhost:3201/video/${props.videoName}`} type='video/mp4'></source>
      </video>
    )
}

export default VideoPlayer
